REM   Script: Db
REM   .

create table Aeroporto( 
    Icao char(4) primary key, 
    Num_Piste number(1,0), 
    Citta varchar(20) 
);

create table Contatti_Aeroporto( 
    PEC_A varchar(30), 
    Email_A varchar(30) unique,  
    Tel1_A varchar(15) not null, 
    Tel2_A varchar(15) not null, 
    Fax_A char(15), 
    Icao char(4),  
CONSTRAINT email CHECK (REGEXP_LIKE(Email_A,'^\w+@\w+\.\w+$')), 
    CONSTRAINT pec CHECK (REGEXP_LIKE(PEC_A,'^\w+@\w+\.\w+$')), 
    constraint FK_Icao foreign key(Icao) references Aeroporto(Icao), 
    constraint PK_Icao primary key (Icao, PEC_A) 
);

create table Compagnia( 
    Iata char(3) primary key, 
    Nome_Comp varchar(20) 
);

create table Contatti_Compagnia( 
    PEC_C varchar(30), 
    Email_C varchar(30) unique,  
    Tel1_C varchar(15) not null, 
    Tel2_C varchar(15) not null, 
    Fax_C char(15), 
    Iata char(3),  
    constraint FK_Iata2 foreign key(Iata) references Compagnia(Iata), 
CONSTRAINT email2 CHECK (REGEXP_LIKE(Email_C,'^\w+@\w+\.\w+$')), 
    CONSTRAINT pec2 CHECK (REGEXP_LIKE(PEC_C,'^\w+@\w+\.\w+$')), 
    constraint PK_Iata primary key(Iata, PEC_C) 
);

create table Aereo( 
    Marca_Imm varchar(6) primary key, 
    Peso number(5,0), 
    Potenza varchar(7), 
    N_Posti number(3,0) not null, 
    constraint LimitePosti check(N_Posti>20) 
);

create table Volo( 
    Cod_V varchar(7), 
    Durata number(3,0), 
    Ora_Part date, 
    Ora_Arr date, 
    Tipo_Volo varchar(14), 
    Ora_Part_Eff date, 
    Ora_Arr_Eff date, 
    Icao_P char(4), 
    Icao_A char(4), 
    Iata char(3), 
    Marca_Imm varchar(6), 
    constraint Ora check (Ora_Part<Ora_Arr), 
    constraint OraF check (Ora_Part_Eff<Ora_Arr_Eff), 
    constraint TipoVolo check( Tipo_Volo in ('Nazionale', 'Internazionale')), 
    constraint FK_Icao2 foreign key(Icao_P) references Aeroporto(Icao), 
    constraint FK_Icao3 foreign key(Icao_A) references Aeroporto(Icao), 
    constraint FK_Iata foreign key(Iata) references Compagnia(Iata), 
    constraint FK_MarcaImm foreign key(Marca_Imm) references Aereo(Marca_Imm), 
    constraint PK_Volo primary key (Iata, Cod_V) 
);

create table Bagaglio( 
    Tag varchar(12) primary key, 
    Tipo varchar(8) check (Tipo in('A mano', 'Da stiva')), 
    Peso_B number(2,0) check (Peso_B<=32) 
);

create table Viaggiatori( 
    ID_Viag varchar(4) primary key, 
    Nome varchar(20), 
    Cognome varchar(15), 
    Tel_V varchar(15) unique, 
    DN date, 
    Email_V varchar(30) unique 
CONSTRAINT email3 CHECK (REGEXP_LIKE(Email_V,'^\w+@\w+\.\w+$')) 
);

create table Licenza( 
    Cod_L char(5) primary key, 
    Tipo_L varchar (30), 
    Data_Cons date, 
    Matricola varchar(7), 
    constraint Cod_L check(Cod_L in('LAPL', 'ATPL')), 
    constraint Tipo_L check(Tipo_L in('Pilota di aeromobili leggeri', 'Pilota di linea')), 
    constraint Data_Cons check (Data_Cons<TO_DATE('24/may/2024 00:00:00', 'dd/mon/yyyy hh24:mi:ss')), 
    constraint FKMat foreign key(Matricola) references PersonaleBordo(Matricola) 
);

create table Passeggero( 
    CF char(16) primary key, 
    N_Passaporto char(9) unique, 
    ID_Viag varchar(4), 
    constraint FKViag foreign key(ID_Viag) references Viaggiatori(ID_Viag) 
);

create table PersonaleBordo( 
    Matricola varchar(7) primary key, 
    Ruolo varchar(9), 
    ID_Viag varchar(4), 
    Cod_V varchar(7), 
    Iata char(3), 
    constraint Ruolo check (Ruolo in ('Pilota', 'Co-pilota', 'Hostess')), 
    constraint FKID_Viag foreign key(ID_Viag) references Viaggiatori(ID_Viag), 
    constraint FKCod_V foreign key(Iata, Cod_V) references Volo(Iata, Cod_V) 
);

create table Documento( 
    N_Doc char(9) primary key, 
    Ente_Ril char(6), 
    Data_Scad date, 
    CF char(16), 
    constraint Ente_Ril check(Ente_Ril in('Comune')), 
    constraint Data_Scad check (Data_Scad>TO_DATE('24/may/2024 00:00:00', 'dd/mon/yyyy hh24:mi:ss')), 
    constraint FKCF foreign key(CF) references Passeggero(CF) 
);

create table HaBagaglio( 
    CF char(16), 
    Tag varchar(12), 
    constraint FKCF2 foreign key(CF) references Passeggero(CF), 
    constraint FKTag foreign key(Tag) references Bagaglio(Tag), 
    constraint PKHB primary key(CF, Tag) 
);

create table CartaImbarco( 
    Numero varchar(20), 
    N_Posto varchar(4), 
    Data_V date, 
    Cod_V varchar(7), 
    Iata char(3), 
    CF char(16), 
    constraint FKCV foreign key(Iata, Cod_V) references Volo(Iata, Cod_V), 
    constraint FKCF3 foreign key(CF) references Passeggero(CF), 
    constraint PKCB primary key (Numero, Iata, Cod_V) 
);

create table Pagamento( 
    N_Carta char(16) primary key, 
    Importo number(4,0), 
    Data_Pag date not null, 
    Data_Scad_Cart date, 
    CF char(16), 
    constraint Data_Scad_Cart check (Data_Scad_Cart>TO_DATE('24/may/2024 00:00:00', 'dd/mon/yyyy hh24:mi:ss')), 
    constraint FKCF4 foreign key(CF) references Passeggero(CF) 
);

create table Biglietto( 
    Cod_B varchar(20) primary key, 
    Classe char(1), 
    Cod_V varchar(7), 
    Iata char(3), 
    CF char(16), 
    constraint Classe check(Classe in ('J', 'F', 'Y')), 
    constraint FKCV3 foreign key(Iata, Cod_V) references Volo(Iata, Cod_V), 
    constraint FKCF5 foreign key(CF) references Passeggero(CF) 
);

create table ERiferito( 
    N_Carta char(16), 
    Cod_B varchar(20), 
    constraint FKPB foreign key(N_Carta) references Pagamento(N_Carta), 
    constraint FKPB2 foreign key(Cod_B) references Biglietto(Cod_B), 
    constraint PKPB primary key(N_Carta, Cod_B) 
);

