SELECT Nome, Cognome, floor(MONTHS_BETWEEN(sysdate, DN)/12) as Età  
from Viaggiatori V join Passeggero P on V.ID_Viag=P.ID_Viag 
join Biglietto B on B.CF=P.CF 
join Volo VO on VO.Cod_V=B.Cod_V 
where B.Classe='J' and VO.Icao_P='KJFK' ;

