create or replace procedure AggiornamentoVoli ( 
IataN Compagnia.Iata%type, 
Cod_VN Volo.Cod_V%type, 
Ora_Part_EffN  date, 
Ora_Arr_EffN date, 
Icao_PN Volo.Icao_P%type, 
Icao_AN Volo.Icao_A%type, 
Marca_ImmN Aereo.Marca_Imm%type 
)  
as 
Peso_Aereo number(4,0); 
N_Posti_Occupati number(3,0); 
NoAereo exception; 
begin 
--Aggiornamento ora effettiva del volo 
update Volo 
set Ora_Part_Eff = Ora_Part_EffN, 
Ora_Arr_Eff = Ora_Arr_EffN, 
Icao_P = Icao_PN, 
Icao_A = Icao_AN, 
Marca_Imm = Marca_ImmN 
where Iata = IataN and Cod_V = Cod_VN; 
 
--Calcolo posti occupati 
select count (N_Posto) into N_Posti_Occupati 
    from CartaImbarco   
    where Cod_V=Cod_VN; 
     
    -- Aggiorna il numero di posti disponibili nell'aereo 
update Aereo 
set N_Posti = N_Posti - N_Posti_Occupati 
where Marca_Imm = Marca_ImmN; 
 
--Il peso dell'aereo non deve essere minore di 10000 
select Peso into Peso_Aereo 
from Aereo  
where Marca_Imm = Marca_ImmN; 
if Peso_Aereo<10000 then 
raise NoAereo; 
end if; 
commit; 
exception 
when NoAereo then 
RAISE_APPLICATION_ERROR(-20020, 'Peso aereo non valido'); 
rollback; 
end; 
 
 
 
 
 
 
 
 
 
 
 

/

create or replace function GestioneA 
    return PersonaleBordo.Matricola%type 
as 
PiuPiccolo PersonaleBordo.ID_Viag%type; 
PiuPiccoloM PersonaleBordo.Matricola%type; 
PiuPiccoloR PersonaleBordo.Ruolo%type; 
Dura number(4,0):=0; 
Negativo exception; 
begin 
 select PB.ID_Viag into PiuPiccolo  
     from Viaggiatori V join PersonaleBordo PB on V.ID_Viag=PB.ID_Viag 
    where  V.DN= (select min(DN) from Viaggiatori); 
 
select PB.Matricola into PiuPiccoloM  
     from Viaggiatori V join PersonaleBordo PB on V.ID_Viag=PB.ID_Viag 
    where V.DN= (select min(DN) from Viaggiatori); 
return PiupiccoloM; 
 
select Ruolo into PiuPiccoloR 
     from Viaggiatori V join PersonaleBordo PB on V.ID_Viag=PB.ID_Viag 
    where V.DN= (select min(DN) from Viaggiatori); 
 
select Durata into Dura 
from PersonaleBordo PB join Viaggiatori V on V.ID_Viag=PB.ID_Viag join Volo VO on PB.Cod_V=VO.Cod_V 
where V.DN= (select min(DN) from Viaggiatori); 
if Dura<0 then 
raise Negativo; 
end if; 
   exception 
when Negativo then 
RAISE_APPLICATION_ERROR(-20022, ‘Impossibile’); 
end; 
 
 
 
 
 
 
 
 
 
 

/

