create or replace function Durata(Cod_VN Volo.Cod_V%type, IataN Volo.Iata%type) 
    return number 
as 
    durataEff number(5,0); 
CFn Passeggero.CF%type; 
Marca_Immn Aereo.Marca_Imm%type; 
begin  
    select (Ora_Arr_Eff-Ora_Part_Eff)*24*60 into durataEff 
    from Volo 
    where Iata=IataN and Cod_V=Cod_VN; 
return durataEff; 
 
select listagg(CF, ',') within group (order by CF) into CFn 
from CartaImbarco 
where Iata=IataN and Cod_V=Cod_VN; 
 
select A.Marca_Imm into Marca_Immn 
from Aereo A join Volo V on A.Marca_Imm=V.Marca_Imm  
where A.Marca_Imm=(select Marca_Imm from Aereo 
    where Iata=IataN and Cod_V=Cod_VN); 
 
exception 
 when NO_DATA_FOUND then 
return 'Nessun dato per questo volo'; 
end; 
 
 
 
 
 
 
 
 
 
 
 

/

create or replace procedure Classe(Importon Pagamento.Importo%type) 
as 
imp Pagamento.Importo%type; 
begin 
select P.Importo into imp 
from Pagamento P join Biglietto B on P.CF=B.CF join Volo V on B.Cod_V=V.Cod_V 
where P.Importo=Importon and Classe='J' and V.Durata>100; 
if imp<500 then 
DBMS_OUTPUT.PUT_LINE('Non è classe business'); 
else 
DBMS_OUTPUT.PUT_LINE('Classe business'); 
end if; 
commit; 
exception 
when NO_DATA_FOUND then 
DBMS_OUTPUT.PUT_LINE('Non esiste'); 
rollback; 
end; 
 
 
 
 
 
 
 
 
 
 
 
 

/

create or replace function VRyanair (Tipo_Ln Licenza.Tipo_L%type, Cod_Vn Volo.Cod_V%type) 
return varchar 
as 
cod Volo.Cod_V%type; 
begin 
select max(V.Cod_V) into cod 
from Compagnia C join Volo V on C.Iata=V.Iata 
join PersonaleBordo PB on PB.Cod_V=V.Cod_V 
join Licenza L on L.Matricola=PB.Matricola 
where Tipo_L=Tipo_Ln and V.Cod_V=Cod_Vn; 
return cod; 
   exception 
when NO_DATA_FOUND then 
DBMS_OUTPUT.PUT_LINE('Voli non trovati'); 
end; 
 
 
 
 
 
 
 
 
 
 
 
 

/

create or replace procedure Economy(Importoe Pagamento.Importo%type) 
as 
importo Pagamento.Importo%type; 
begin 
select P.Importo into importo 
from Pagamento P join Biglietto B on P.CF=B.CF join Volo V on B.Cod_V=V.Cod_V 
where P.Importo=Importoe and Classe='F' and V.Tipo_Volo='Internazionale'; 
if importo>800 then 
DBMS_OUTPUT.PUT_LINE('Non è classe economy'); 
else 
DBMS_OUTPUT.PUT_LINE('Classe economy'); 
end if; 
commit; 
exception 
when NO_DATA_FOUND then 
DBMS_OUTPUT.PUT_LINE('Non esiste'); 
rollback; 
end; 
 
 
 
 
 
 
 
 
 
 
 
 

/

create or replace view VoliPiloti as 
select VRyanair(Tipo_L, V.Cod_V) as VP, 
Marca_Imm as Aereo,  
Nome_Comp as Compagnia, 
Tipo_L as L, 
Ruolo as R 
from Compagnia C join Volo V on C.Iata=V.Iata 
join PersonaleBordo PB on PB.Cod_V=V.Cod_V 
join Licenza L on L.Matricola=PB.Matricola 
order by VP 
 
 
 
 
 
 
 
 
 
 
 
 
;

create or replace view DurataVoli as 
select distinct Durata(V.Cod_V, V.Iata) as DV, 
V.Marca_Imm as AereoVolo, 
V.Cod_V as CV, 
Data_V as DataVolo, 
V.Icao_P as Partenza, 
V.Icao_A as Arrivo 
from CartaImbarco C join Volo V on V.Cod_V=C.Cod_V  
join Aeroporto A on A.Icao=V.Icao_P 
order by DV 
 
 
 
 
 
 
 
 
 
 
 
 
;

create or replace view Sostituzione as 
select distinct GestioneA as Giovane 
from PersonaleBordo 
 
 
 
 
 
 
 
 
 
 
 
 
;

create or replace view Compagnie as 
select C.Iata, 
Nome_Comp as Compagnia, 
Pec_C as Pec, 
Tel1_C as Telefono_Principale, 
Tel2_C as Telefono_Secondario 
from Compagnia C join Contatti_Compagnia CC on C.Iata=CC.Iata 
order by Iata 
 
 
 
 
 
 
 
 
 
 
 
 
 
;

create or replace view Aeroporti as 
select A.Icao, 
Citta as Citta, 
PEC_A as Pec, 
Tel1_A as Telefono_Principale, 
Tel2_A as Telefono_Secondario 
from Aeroporto A join Contatti_Aeroporto CA on A.Icao=CA.Icao 
order by Icao 
 
 
 
 
 
 
 
 
 
 
 
 
 
;

create or replace view Vendite as 
select E.Cod_B as CodiceBiglietto, 
E.N_Carta as Carta, 
Data_Pag as Data_Pagamento, 
Importo as Importo_Pagato, 
P.CF as Codice_Fiscale_Passeggero, 
Cod_V as Volo, 
Classe as Classe_Volo 
from ERiferito E join Pagamento P on E.N_Carta=P.N_Carta 
join Biglietto B on E.Cod_B=B.Cod_B 
order by Importo_Pagato 
 
 
 
 
 
 
 
 
 
 
 
 
 
;

create or replace view Controllo as 
select B.Cod_B as CodiceBiglietto, 
Numero as Carta_Imbarco, 
Data_V as Data_Volo, 
N_Passaporto as Numero_Passaporto, 
C.CF as Codice_Fiscale_Passeggero, 
N_Doc as Numero_Documento, 
Data_Scad as Scadenza_Documento, 
BL.Tag as Tag_Bagaglio, 
Peso_B as Peso_Controllato, 
C.Cod_V as Codice_Volo 
from CartaImbarco C join Passeggero P on C.CF=P.CF 
join Biglietto B on P.CF=B.CF 
join Documento D on P.CF=D.CF 
join HaBagaglio HB on HB.CF=P.CF 
join Bagaglio BL on BL.Tag=HB.Tag 
order by Peso_Controllato 
 
 
 
 
 
 
 
 
 
 
 
 
;

create or replace view Aerei as  
select Peso as Peso_Aereo, 
A.Marca_Imm as Targa, 
N_Posti as Posti, 
Cod_V as Codice_Volo 
From Aereo A join Volo V on A.Marca_Imm=V.Marca_Imm 
Order by Peso 
 
 
 
 
 
 
 
 
 
 
 
 
 
;

