NonPartire exception; 
begin 
select Ora_Part_Eff into Partenza 
from Volo 
where Cod_V=:new.Cod_V; 
if Partenza=:new.Ora_Part_Eff then 
raise NonPartire; 
end if; 
exception 
when NO_DATA_FOUND then 
